sys_variable_value.value:
(function execute(inputs, outputs) {
//gs.include("ethjs-format");
//gs.include("object-assign");
gs.include("ethjs-signer");


var transaction = { "from": inputs.from.toString(),
  "to": inputs.to.toString(),
  "gas": inputs.gas.toString(),
  "gasPrice": inputs.gasprice.toString(),
  "value": inputs.value.toString(),
  "nonce": inputs.nonce.toString(),
  "data": inputs.data.toString()
};

var gr = new GlideRecord('x_snc_ethsign_keys');
gr.addQuery('address',inputs.from.toString());
gr.query();
if (gr.next()) {
  var pk = gr.private_key;
}
gs.info("pk: " + pk);

outputs.txraw = ethSigner.sign(transaction, pk.toString(), false);

gs.info(outputs.txraw);
})(inputs, outputs);

